#include<fstream>

// Function to find the greatest common divisor (Euclidean algorithm)
int gcd(int a, int b) {
    while (b != 0) {
        int t = b;
        b = a % b;
        a = t;
    }
    return a;
}

int main() {
    std::ifstream fin("tort.in");
    std::ofstream fout("tort.out");

    int M, N;
    fin >> M >> N;

    // Find the greatest common divisor of M and N
    int L = gcd(M, N);

    // Calculate the number of portions
    int portions = (M * N) / (L * L);

    // Write result to output file
    fout << portions << " " << L;

    return 0;
}
